  width: 100%;
  background-color: #fff;
  padding: 20px;
  box-shadow: 0px 0px 5px #ccc;
  max-width: 880px;
  margin: 20px auto;
  word-break: break-all;
`;

export const Thead = styled.thead``;

export const Tr = styled.tr``;

export const Th = styled.th`
    text-aling:start;
    border-bottom: inset;
    padding-bottom; 5px;

    @media (max-width:500px){
    }
`;



const Grid = () => {
  return (
    <Table>
      <Thead>
        <Tr>
          <Th>Nome</Th>
          <Th>Email</Th>
          <Th>Fone</Th>
        </Tr>
      </Thead>
      {/* Adicione o corpo da tabela aqui */}
    </Table>
  );
};

export default Grid;
